        Double I_ESP_Px_S_M11_vrr = PAX*I_ESP_S_S_M11_vrr-PRX*I_ESP_S_S_M12_vrr;
        Double I_ESP_Py_S_M11_vrr = PAY*I_ESP_S_S_M11_vrr-PRY*I_ESP_S_S_M12_vrr;
        Double I_ESP_Pz_S_M11_vrr = PAZ*I_ESP_S_S_M11_vrr-PRZ*I_ESP_S_S_M12_vrr;

